import React, { Component } from 'react';
import { auth, createStuDocument } from '../config';
import DashBoard from "./Dashboard";
import "./Create.css";

class Singup extends Component {
  state = { stuname: '', email: '', password: '', stunum: '', cid: '' };



  handleChange = (e) => {
    const { name, value } = e.target;

    this.setState({ [name]: value });
  };

  handleSubmit = async (e) => {
    e.preventDefault();
    const { email, password, stuname, stunum } = this.state;
    try {
      console.log(stuname, stunum);
      const { user } = await auth.createUserWithEmailAndPassword(
        email,
        password
      );
      console.log(user,stunum);
      await createStuDocument(user, { stuname, stunum });
      this.props.history.push("/");
    } catch (error) {
      console.log('error', error);
    }

    this.setState({ stuname: '', email: '', password: '', stunum: '' });
  };

  render() {
    const { stuname, email, password, stunum } = this.state;
    return (
      <div>
        <>
        <header>
          <DashBoard />
        </header>
        <div className="container">
          <div className="panel panel-default">
            <div className="panel-body ">
              <br />
              <br />
              <h4 className="text-center">เพิ่มนักเรียนใหม่</h4>
              <br />
              <form onSubmit={this.handleSubmit}>
                <div classNameName="form-group">
                  <label for="title">รหัสนักเรียน :</label>
                  <input
                    type="text"
                    className="form-control in fw-normal"
                    name="stunum"
                    value={stunum}
                    onChange={this.handleChange}
                    placeholder="กรอกรหัสนักเรียน (ตัวอย่าง 000001)"
                  />
                </div>
                <div className="form-group">
                  <label for="title">ชื่อ - นามสกุล :</label>
                  <input
                    type="text"
                    className="form-control in"
                    name="stuname"
                    value={stuname}
                    onChange={this.handleChange}
                    placeholder="กรอกชื่อ - นามสกุล"
                  />
                </div>
                <div className="form-group">
                  <label for="author">รหัสชั้นเรียน :</label>
                  <input
                    type="text"
                    className="form-control in"
                    name="cid"
                    value={cid}
                    onChange={this.handleChange}
                    placeholder="รหัสรหัสชั้นเรียน (ตัวอย่าง 11)"
                  />
                </div>
                <div className="form-group">
                  <label for="author">ชั้นปี :</label>
                  <input
                    type="text"
                    className="form-control in"
                    name="croom"
                    value={croom}
                    onChange={this.handleChange}
                    placeholder="กรอกเลขชั้นปี"
                  />
                </div>
                <div className="form-group">
                  <label for="title">ห้อง :</label>
                  <input
                    type="text"
                    className="form-control in"
                    name="nroom"
                    value={nroom}
                    onChange={this.handleChange}
                    placeholder="กรอกเลขห้อง"
                  />
                </div>
                <div className="text-center">
                  <br />
                  <button
                    type="submit"
                    className="btn btn-success text-center bt"
                  >
                    เพิ่ม
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </>
      </div>
    );
  }
}

export default Singup;
